In an abstract mountain landscape, Simon Porte @Jacquemus presented a co-ed collection that was sexy, practical and modular all at once with pieces that celebrate the body and energetic designs that can reinvent themselves over and over again

Dans un décor de montagne abstraite, Simon Porte @Jacquemus a présenté une collection homme et femme à la fois sexy, utilitaire et modulable, un vestiaire qui célèbre les corps et l’énergie d’une mode qu’on peut réinventer à l’envi.

